import "./Header.scss";
import React from "react";
import { useTranslation } from "react-i18next";
import "../i18n";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { ChangeLanguageButton } from '../changeLanguageButton/changeLanguageButton';

export const Header = () => {
  const { t, i18n } = useTranslation();

  return (
    <div className="header">
      <div className="header-wrapper">
        <Link to="/">
          <div className="logo">
            <div className="logo-icon"></div>
          </div>
        </Link>
        <nav className="nav">
          <Link to="/platform">
            <div className="platform">{t("platform")}</div>
          </Link>
          <Link to="/about-app">
            <div className="about-app">{t("about-app")}</div>
          </Link>
          <Link to="/study-page">
            <div className="about-app">{t("study-page")}</div>
          </Link>
          <Link to="/log-in">
            <div className="log-in">{t("log-in")}</div>
          </Link>
          <Link to="/get-started">
          <div className="get-started">{t("get-started")}</div>
          </Link>
          <ChangeLanguageButton />
        </nav>
      </div>
    </div>
  );
};
